import React, {Component} from 'react'


class Profil extends Component{
  
    render(){
       const { FullName, bio , profession} = this.props;

      return(
        <div>
         
          <h1>{FullName}</h1>
          <h1>{bio}</h1>
          <h1>{profession}</h1>
        </div>
      )
      
    }
  }

export default Profil
